(114, 1, 'PHP Developer', 1000, 1603085812, 0, '&lt;table style=&quot;padding: 0px; border: 0px; border-spacing: 0px; color: #000000; font-family: Arial, HelveticaNeue, Helvetica, sans-serif; font-size: 16px; background-color: #ffffff; width: 881px; height: 1677px;&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td style=&quot;font-size: 1em; padding-top: 20px; text-align: center;&quot; align=&quot;center&quot;&gt;&lt;a style=&quot;color: #000000; font-size: 1em; font-weight: bold; text-decoration-line: none;&quot; href=&quot;https://www.jobs.bg/company/218615&quot;&gt;&lt;img style=&quot;width: 600px;&quot; src=&quot;https://assets.jobs.bg/assets/logo/2015-07-01/b_a2a88b4ab1fd22feea48d25db302ab24.jpg&quot; border=&quot;0&quot; /&gt;&lt;/a&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td style=&quot;font-size: 1em; padding-top: 20px; padding-bottom: 20px;&quot; align=&quot;center&quot;&gt;\r\n&lt;table style=&quot;padding: 0px; border: 0px; border-spacing: 0px; width: 700px;&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td class=&quot;jobTitle&quot; style=&quot;font-size: 1.8em; font-weight: bold; padding-bottom: 20px; line-height: 1.3;&quot;&gt;\r\n&lt;h1 class=&quot;no-style&quot; style=&quot;padding: 0px; margin: 0px; font-weight: inherit; font-size: inherit;&quot;&gt;PHP Developer&lt;/h1&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td class=&quot;htmlTemplate&quot; style=&quot;font-size: 1em; line-height: 1.5;&quot;&gt;&lt;span style=&quot;font-size: 1em; font-weight: inherit; color: #00ccff;&quot;&gt;&lt;strong&gt;Circles Bulgaria Ltd&lt;/strong&gt;&lt;/span&gt;&amp;nbsp;is a distinctive global leader of software solutions in the security and intelligence market. We are a company with over 500 dedicated professionals in R&amp;amp;D, development &amp;amp; integration and offices worldwide. We develop our own products using cutting-edge mobile and cyber technologies.&lt;br /&gt;&lt;br /&gt;For our office located in Sofia we are looking for passionate people to join our team as:&lt;br /&gt;&lt;br /&gt;&lt;span style=&quot;font-size: 22px; font-weight: inherit; color: #00ccff;&quot;&gt;&lt;strong&gt;PHP DEVELOPER&lt;/strong&gt;&lt;/span&gt;&lt;br /&gt;&amp;nbsp;&lt;br /&gt;&lt;strong&gt;What will you participate in:&lt;/strong&gt;&lt;br /&gt;\r\n&lt;ul&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Developing of web-based, content-driven applications with a long life-cycle;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Integration of new functionalities into existing applications with a modular approach;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Close work with cross-functional team members throughout the Software Development Life Cycle (SDLC);&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Handle multiple tasks effectively and communicate well;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Demonstrate excellent teamwork and collaboration skills.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;br /&gt;&lt;br /&gt;&lt;strong&gt;The following technical skill-set is mandatory for a successful candidate:&lt;/strong&gt;&lt;br /&gt;\r\n&lt;ul&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Bachelor or Master degree in computer science/informatics or equivalent&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;3+ years of experience in web development&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;In-depth knowledge of modern, object-oriented PHP&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Practical experience with Symfony or Laravel&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with MySQL/MariaDB and InnoDB storage engine&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with RESTful APIs&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Knowledge and understanding of the Linux operating system as a development platform (CentOS, Ubuntu)&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Familiarity with standard security practices in web development&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with Git&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Familiarity with Agile development practices&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Familiarity with the fundamental Internet, Transport and Application level protocols - IP, TCP / UDP, HTTP / TLS / SSL / SSH&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;strong&gt;&lt;br /&gt;The following technical skill-set is mandatory for a successful candidate&lt;/strong&gt;&lt;br /&gt;\r\n&lt;ul&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with Docker&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with HTML and CSS, JS. Experience with Angular /preferred/ and/or React is considered as an advantage &amp;nbsp;Any Front-end technology is considered as a serious advantage&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Knowledge in Python is considered as an advantage&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Shell scripting on Linux, including basic knowledge of network configuration and diagnostic tools and commands, like ifconfig, ip, iptables and tcpdump&amp;nbsp;&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;br /&gt;&lt;strong&gt;Our offer:&lt;/strong&gt;&lt;br /&gt;\r\n&lt;ul&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Work in a multicultural environment&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Professional and friendly atmosphere&amp;nbsp;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Attractive compensation package which includes, but isn&amp;rsquo;t limited to, the following: lunch remuneration, 25 days paid-leave days, medical insurance, and a Multisport card&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Formal annual employee evaluation&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Standard working hours of Monday to Friday from 9.00h &amp;ndash; 18.00h&amp;nbsp;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Team activities and team-building sessions&lt;/li&gt;\r\n&lt;/ul&gt;\r\nIf you consider that Circles Bulgaria is the next place in your career path we will be happy to consider you among the best matches for the position. Only shortlisted candidates will be contacted.&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;'),
