mp;bull;     ;&lt;br /&gt;&lt;br /&gt;   :&lt;br /&gt;&amp;bull;    ;&lt;br /&gt;&amp;bull;     ;&lt;br /&gt;&amp;bull;  ;&lt;br /&gt;&lt;br /&gt;              .&lt;br /&gt;,  ,         ,     !&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;');
INSERT INTO `posts` (`id`, `Author`, `Title`, `Reward`, `Date`, `Is_Finished`, `Body`) VALUES
(116, 1, 'PHP Developer', 3423, 1603086189, 0, '&lt;table style=&quot;padding: 0px; border: 0px; border-spacing: 0px; color: #000000; font-family: Arial, HelveticaNeue, Helvetica, sans-serif; font-size: 16px; background-color: #ffffff; width: 997px; height: 1651px;&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td style=&quot;font-size: 1em; padding-top: 20px;&quot; align=&quot;center&quot;&gt;&lt;a style=&quot;color: #000000; font-size: 1em; font-weight: bold; text-decoration-line: none;&quot; href=&quot;https://www.jobs.bg/company/225631&quot;&gt;&lt;img style=&quot;height: 300px;&quot; src=&quot;https://assets.jobs.bg/assets/logo/2015-10-29/b_ec660ecd48e7c9c51a0b0072d81e8146.png&quot; border=&quot;0&quot; /&gt;&lt;/a&gt;&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td style=&quot;font-size: 1em; padding-top: 20px; padding-bottom: 20px;&quot; align=&quot;center&quot;&gt;\r\n&lt;table style=&quot;padding: 0px; border: 0px; border-spacing: 0px; width: 700px;&quot;&gt;\r\n&lt;tbody&gt;\r\n&lt;tr&gt;\r\n&lt;td class=&quot;jobTitle&quot; style=&quot;font-size: 1.8em; font-weight: bold; padding-bottom: 20px; line-height: 1.3;&quot;&gt;\r\n&lt;h1 class=&quot;no-style&quot; style=&quot;padding: 0px; margin: 0px; font-weight: inherit; font-size: inherit;&quot;&gt;PHP Developer&lt;/h1&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;tr&gt;\r\n&lt;td class=&quot;htmlTemplate&quot; style=&quot;font-size: 1em; line-height: 1.5;&quot;&gt;Strings IT Recruitment is helping IT/tech professionals discover more exciting career opportunities. Free of charge, of course.&lt;br /&gt;&lt;br /&gt;Our client is a Belgium-based, global software company specialized in web and mobile solutions in the field of social networks.&lt;br /&gt;&lt;br /&gt;For the last quarter of 2020, they are looking to bring at least one mid-level PHP developer into their Sofia team, where they currently employ around 25 people.&lt;br /&gt;&amp;nbsp;&lt;br /&gt;&lt;span style=&quot;font-size: 20px; font-weight: inherit;&quot;&gt;Your day at work:&lt;/span&gt;&lt;br /&gt;\r\n&lt;ul&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Work closely with teammates from Bulgaria, Belgium and Romania;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Develop new products and features;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Bug-fix and support existing products and features.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;span style=&quot;font-size: 20px; font-weight: inherit;&quot;&gt;Your profile:&lt;/span&gt;&lt;br /&gt;\r\n&lt;ul&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;At least 3 years (ideally 5+ years) of professional experience with PHP;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Strong knowledge of PHP7;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Strong knowledge of MySQL (design, queries);&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with RESTful APIs;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Strong object-oriented programming skills (OOP);&amp;nbsp;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with MVC frameworks (e.g. Laravel, Symfony, Zend);&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Knowledge of HTML/CSS/Javascript;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with Composer;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with Git;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with automated testing/TDD;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with NoSQL technologies (Dynamo, SQS);&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Some scaling techniques.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;span style=&quot;font-size: 20px; font-weight: inherit;&quot;&gt;Bonus points:&lt;/span&gt;&lt;br /&gt;\r\n&lt;ul&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with Amazon Web Services (AWS);&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with Docker;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with Terraform;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Experience with Scrum, Kanban.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;span style=&quot;font-size: 20px; font-weight: inherit;&quot;&gt;The offer:&lt;/span&gt;&lt;br /&gt;\r\n&lt;ul&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Starting salary: 3000-5000 bgn net/month;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;You will get your own 15&amp;rdquo; Macbook Pro;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;(Really) flexible working hours;&amp;nbsp;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Remote work - 5 days per month (unused remote days can be used in the following months);&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Additional health insurance;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Food vouchers;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;You will get the chance to work on websites and apps with high traffic;&lt;/li&gt;\r\n&lt;li style=&quot;font-size: 1em;&quot;&gt;Convenient office location in Sofia&amp;rsquo;s city center.&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;br /&gt;Looks interesting? Use the APPLY button below. All applications will be treated in strict confidentiality. Only short-listed candidates will be contacted.&lt;br /&gt;&lt;br /&gt;Strings IT Recruitment\'s hiring activities are based upon Recruitment License No 1937 issued on 24.09.2015 with unlimited validity.&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;\r\n&lt;/td&gt;\r\n&lt;/tr&gt;\r\n&lt;/tbody&gt;\r\n&lt;/table&gt;'),
